import React, {useEffect, useRef} from 'react';
import { useState } from 'react';
import { useAuth0 } from '@auth0/auth0-react';
import {firestore} from "./firebase"
import {addDoc, getDocs, collection} from "@firebase/firestore"

function Tournament() {

    const { loginWithRedirect, logout, user, isAuthenticated } = useAuth0();

    const ref = collection(firestore, "natjecanja");
    const [currTour, setCurrTour] = useState({});

    useEffect(() => {
        const fetchData = async () => {
            try {
                const querySnapshot = await getDocs(ref);
                const documents = querySnapshot.docs.map((doc) => ({...doc.data(), id:doc.id }));
                for (let i = 0; i < documents.length; ++i) {
                    if (documents[i].kreator === localStorage.getItem(1)) {
                        let obj = {
                            id: documents[i].id,
                            naziv: documents[i].naziv,
                            kreator: documents[i].kreator,
                            pobjeda: documents[i].pobjeda,
                            remi: documents[i].remi,
                            poraz: documents[i].poraz,
                            igre: documents[i].igre,
                            sudionici: documents[i].sudionici
                        }
                        setCurrTour(obj);
                    }
                }

            } catch (err) {
                console.log(err);
            }
        };
        fetchData();
    },[]);

    return(
    <>
        <div className='table-title'>
            <div>REZULTATI</div>
            <div>{currTour.naziv}</div>
        </div>
        <div className='table-div'>
            <table>
                <tr>
                    <th>Prva momčad</th><th>Druga Momčad</th><th>Rezultat</th>
                </tr>
                <tr>
                    <td>{currTour.igre[0].split("-")[0]}</td><td>{currTour.igre[0].split("-")[1]}</td><td>0:0</td>
                </tr>
                <tr>
                    <td>{currTour.igre[1].split("-")[0]}</td><td>{currTour.igre[1].split("-")[1]}</td><td>0:0</td>
                </tr>
                <tr>
                    <td>{currTour.igre[2].split("-")[0]}</td><td>{currTour.igre[2].split("-")[1]}</td><td>0:0</td>
                </tr>
                <tr>
                    <td>{currTour.igre[3].split("-")[0]}</td><td>{currTour.igre[3].split("-")[1]}</td><td>0:0</td>
                </tr>
                <tr>
                    <td>{currTour.igre[4].split("-")[0]}</td><td>{currTour.igre[4].split("-")[1]}</td><td>0:0</td>
                </tr>
                <tr>
                    <td>{currTour.igre[5].split("-")[0]}</td><td>{currTour.igre[5].split("-")[1]}</td><td>0:0</td>
                </tr>
            </table>
        </div>
    </>    
    )

}

export default Tournament;
